                var color = '#333';
                var weight = 1;
                var layer = layers.features;

                // Style mapping
                switch(f.type) {
                    case 'highway': 
                        color = '#E74C3C'; weight = 6; layer = layers.highways; break;
                    case 'main_road': 
                        color = '#F39C12'; weight = 4; layer = layers.main_roads; break;
                    case 'local_road': 
                        color = '#95A5A6'; weight = 2; layer = layers.local_roads; break;
                    case 'river':
                        color = '#3498DB'; weight = 5; layer = layers.features; break;
                    case 'building':
                        color = '#27AE60'; break;
                    case 'icon':
                        color = '#9B59B6'; break;
                }

                var popupContent = `
                    <b>ID:</b> ${f.id}<br>
                    <b>Type:</b> ${f.type}<br>
                    <b>Priority:</b> ${f.priority}
                `;

                if (f.geometry_type === 'LineString') {
                    // Start/End points for Polyline
                    var latlngs = f.coords.map(c => [c[1], c[0]]); // Swap to Lat/Lng (Y, X)
                    L.polyline(latlngs, {
                        color: color, 
                        weight: weight,
                        opacity: 0.8
                    }).bindTooltip(popupContent, {sticky: true}).addTo(layer);
                    
                    // Collect bounds
                    latlngs.forEach(p => bounds.push(p));
                    
                    // Add Label at midpoint
                    if (f.id && layer !== layers.local_roads) { // Skip local road labels for clarity
                        var mid = latlngs[Math.floor(latlngs.length / 2)];
                        var labelIcon = L.divIcon({
                            className: 'map-label',
                            html: f.id,
                            iconSize: null
                        });
                        L.marker(mid, {icon: labelIcon}).addTo(layers.labels);
                    }

                } else if (f.geometry_type === 'Point') {
                    var latlng = [f.coords[0][1], f.coords[0][0]];
                    bounds.push(latlng);
                    
                    L.circleMarker(latlng, {
                        radius: f.type === 'icon' ? 8 : 4,
                        fillColor: color,
                        color: '#fff',
                        weight: 1,
                        opacity: 1,
                        fillOpacity: 0.8
                    }).bindTooltip(popupContent).addTo(layer);

                    // Label for points
                    var labelIcon = L.divIcon({
                        className: 'map-label',
                        html: f.id,
                        iconSize: null
                    });
                    // Offset label slightly
                    L.marker([latlng[0] + 20, latlng[1]], {icon: labelIcon}).addTo(layers.labels);
                }
            });

            if (bounds.length > 0) {
                map.fitBounds(bounds, {padding: [50, 50]});
            }
            
            function toggleLabels() {
                if (map.hasLayer(layers.labels)) {
                    map.removeLayer(layers.labels);
                } else {
                    map.addLayer(layers.labels);
                }
            }
            
            L.control.layers(null, layers).addTo(map);
